window.bookSummaryJSON = "<p>\"A thrilling, pulse-pounding addition to the genre with compelling science and a frightening twist.\" (Nicholas Sansbury Smith, <i>NY Times</i> and <i>USA Today</i> best-selling author of the Extinction Cycle and Hell Divers series)</p> <p>This audiobook contains the first four audiobooks of the Tide series, filled with post-apocalyptic action, suspense, and intrigue.&nbsp;&nbsp;</p> <p>A devastating bioweapon will change the face and fate of humanity as we know it.&nbsp;&nbsp;</p> <p>Captain Dominic Holland leads a crew of skilled covert operatives and scientific personnel aboard a clandestine ship dedicated to fighting chemical and biological warfare. Their missions have taken them across the world to combat sinister plots and dangerous adversaries. But their next assignment is more dangerous than any they faced before.&nbsp;</p> <p>Far off the Eastern Coast of the US, intelligence officers discover a covert laboratory on an abandoned oil rig with unspeakable horrors. Twisted creatures wash ashore across the country. Hospitals are overrun by patients suffering from an incurable disease with terrifying symptoms.&nbsp;&nbsp;</p> <p>Dom and his team may be the only ones equipped to find out why. They embark on a globe-trotting race to unravel the apocalyptic mystery behind the bioweapon destroying civilization.&nbsp;</p> <p>But will their efforts be enough to turn the tide - or is humanityâ€™s fate already sealed?</p>"; 
